// 标签实例化类
class SIcon extends HTMLElement {
    connectedCallback() {
        const name = this.getAttribute("name");
        this.innerHTML = iconMap[name];
    }
}

// 创建s2-icon-如果遇到 <s2-icon> 标签 使用SIcon类进行实例化这个标签
customElements.define("s2-icon", SIcon);
